def next_smallest(lst):
    if len(lst) < 2:
        return None
    smallest = None
    second_smallest = None
    for num in lst:
        if smallest is None or num < smallest:
            second_smallest = smallest
            smallest = num
        elif second_smallest is None or num < second_smallest:
            second_smallest = num
    return second_smallest

def is_prime(n):
    """Check if a number is prime."""
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def count_up_to(n):
    """Return the first n prime numbers that are less than n."""
    primes = []
    i = 2
    while len(primes) < n and i < n:
        if is_prime(i):
            primes.append(i)
        i += 1
    return primes

def choose_num(x, y):
    # Check if x and y are positive integers
    if not isinstance(x, int) or not isinstance(y, int) or x <= 0 or y <= 0:
        return "Both x and y must be positive integers."

    # Check if y is greater than x
    if y < x:
        return "y must be greater than or equal to x."

    # Find the largest even number in the range [x, y]
    for i in range(y, x-1, -1):
        if i % 2 == 0:
            return i

    # If no even number was found, return -1
    return -1

def count_nums(arr):
    count = 0
    for num in arr:
        # check if the number is negative
        if num < 0:
            # convert the first digit to negative
            num = -int(str(abs(num))[0]) + int(str(abs(num))[1:])
        # calculate the sum of digits
        digits_sum = sum(map(int, str(num)))
        # increment the count if the sum of digits is greater than 0
        if digits_sum > 0:
            count += 1
    return count

def minSubArraySum(nums):
    n = len(nums)
    min_sum = nums[0]

    for i in range(n):
        for j in range(i+1, n+1):
            sum = 0
            for k in range(i, j):
                sum += nums[k]
            min_sum = min(min_sum, sum)

    return min_sum

def is_sorted(lst):
    if len(lst) == 1:
        return True
    elif len(lst) == 2:
        return lst[0] < lst[1]
    else:
        for i in range(len(lst)-1):
            if lst[i] >= lst[i+1]:
                return False
        return True

def is_nested(string):
    stack = []
    for bracket in string:
        if bracket == "[":
            stack.append(bracket)
        elif bracket == "]":
            if len(stack) == 0 or stack[-1] != "[":
                return False
            stack.pop()

    return len(stack) != 0

